    false,nt"url": null,nt"notes": "This report was written for the purpose
    of updating Area and Regional R&W personnel on the progress made in monitoring duck
    nesting and production on the Bear River Refuge. This study was implemented in 1981
    as an integral part of the intensive waterfowl management program being implemented
    on the refuge.  The survey was also designed to provide information on nesting cover
    preferences, nest success, nest predation and related factors as a means of evaluating
    the effects of refuge management practices on duck production.",nt"owner_org":
